import { NavLink } from "react-router-dom";
import {FaShoppingCart } from "react-icons/fa";

const Navbar = () => {
  
  return (
    <div className=" bg-slate-300 ">
      <nav className="max-w-[1080px] flex justify-between mx-auto items-center">
        <div>
          <img src="./shop-logo.png" alt="logoPic" className="w-20"></img>
        </div>
        <div className="flex gap-2">
          <NavLink to="/">
            <div>Home</div>
          </NavLink>

          <NavLink to="/cart">
            <FaShoppingCart/>
          </NavLink>

        </div>
      </nav>
    </div>
  )
};

export default Navbar;
